import React from "react";

import Banner1 from "../components/Banner1";
import Banner2 from "../components/Banner2";
import Banner3 from "../components/Banner3";
import Banner4 from "../components/Banner4";

const Main = () => {
  return (
    <React.Fragment>
      <Banner1></Banner1>
      <Banner2></Banner2>
      <Banner3></Banner3>
      <Banner4></Banner4>
    </React.Fragment>
  );
};

export default Main;
